import React, { useState } from 'react';
import { TabView, TabPanel } from 'primereact/tabview';
import { Button } from 'primereact/button';
import { Avatar } from 'primereact/avatar';
import { Badge } from 'primereact/badge';
import { useAuth } from './AuthContext';
import InvoiceList from './InvoiceList';
import CreateInvoice from './CreateInvoice';

const Dashboard: React.FC = () => {
  const { user, logout } = useAuth();
  const [activeIndex, setActiveIndex] = useState(0);

  const isAdmin = user?.role === 'admin';

  return (
    <div className="dashboard-container">
      {/* Header */}
      <div className="dashboard-header">
        <div className="header-content">
          <div className="header-left">
            <div className="logo-section">
              <i className="pi pi-credit-card text-3xl text-white"></i>
              <div className="logo-text">
                <h1 className="app-title">Uptiomio</h1>
                <p className="app-subtitle">Upravljanje fakturima i plaÄ‡anjima</p>
              </div>
            </div>
          </div>

          <div className="header-right">
            <div className="user-info">
              <Avatar 
                icon="pi pi-user" 
                className="user-avatar"
                size="large"
              />
              <div className="user-details">
                <span className="user-name">{user?.name}</span>
                <Badge 
                  value={user?.role === 'admin' ? 'Administrator' : 'Korisnik'} 
                  severity={user?.role === 'admin' ? 'info' : 'success'}
                  className="role-badge"
                />
              </div>
            </div>
            <Button
              label="Odjavi se"
              icon="pi pi-sign-out"
              severity="secondary"
              className="logout-button"
              onClick={logout}
            />
          </div>
        </div>
      </div>

      {/* Main Content */}
      <div className="dashboard-content">
        <div className="content-wrapper">
          <TabView 
            activeIndex={activeIndex} 
            onTabChange={(e) => setActiveIndex(e.index)}
            className="main-tabs"
          >
            <TabPanel 
              header={
                <div className="tab-header">
                  <i className="pi pi-file-o"></i>
                  <span>Fakture</span>
                </div>
              }
            >
              <InvoiceList isAdmin={isAdmin} />
            </TabPanel>

            {isAdmin && (
              <TabPanel 
                header={
                  <div className="tab-header">
                    <i className="pi pi-plus"></i>
                    <span>Kreiraj fakturu</span>
                  </div>
                }
              >
                <CreateInvoice />
              </TabPanel>
            )}
          </TabView>
        </div>
      </div>

      <style jsx>{`
        .dashboard-container {
          min-height: 100vh;
          background: #f8fafc;
        }

        .dashboard-header {
          background: linear-gradient(135deg, #667eea 0%, #764ba2 100%);
          box-shadow: 0 4px 20px rgba(0,0,0,0.1);
          position: sticky;
          top: 0;
          z-index: 1000;
        }

        .header-content {
          max-width: 1200px;
          margin: 0 auto;
          padding: 1rem 2rem;
          display: flex;
          justify-content: space-between;
          align-items: center;
        }

        .header-left {
          display: flex;
          align-items: center;
        }

        .logo-section {
          display: flex;
          align-items: center;
          gap: 1rem;
        }

        .logo-text h1 {
          color: white;
          font-size: 1.8rem;
          font-weight: 700;
          margin: 0;
          text-shadow: 0 2px 4px rgba(0,0,0,0.3);
        }

        .logo-text p {
          color: rgba(255,255,255,0.9);
          font-size: 0.9rem;
          margin: 0;
        }

        .header-right {
          display: flex;
          align-items: center;
          gap: 1.5rem;
        }

        .user-info {
          display: flex;
          align-items: center;
          gap: 0.75rem;
        }

        .user-avatar {
          background: rgba(255,255,255,0.2);
          color: white;
        }

        .user-details {
          display: flex;
          flex-direction: column;
          gap: 0.25rem;
        }

        .user-name {
          color: white;
          font-weight: 600;
          font-size: 0.9rem;
        }

        .role-badge {
          font-size: 0.7rem;
        }

        .logout-button {
          background: rgba(255,255,255,0.2);
          border: 1px solid rgba(255,255,255,0.3);
          color: white;
        }

        .logout-button:hover {
          background: rgba(255,255,255,0.3);
        }

        .dashboard-content {
          padding: 2rem;
        }

        .content-wrapper {
          max-width: 1200px;
          margin: 0 auto;
        }

        .main-tabs {
          background: white;
          border-radius: 12px;
          box-shadow: 0 4px 20px rgba(0,0,0,0.08);
          overflow: hidden;
        }

        .tab-header {
          display: flex;
          align-items: center;
          gap: 0.5rem;
          font-weight: 600;
        }

        @media (max-width: 768px) {
          .header-content {
            padding: 1rem;
            flex-direction: column;
            gap: 1rem;
          }

          .header-right {
            width: 100%;
            justify-content: space-between;
          }

          .dashboard-content {
            padding: 1rem;
          }
        }
      `}</style>
    </div>
  );
};

export default Dashboard;
